create table users
(
    id        int auto_increment comment '用户唯一标识ID，自增长'
        primary key,
    username  varchar(50)                         not null comment '用户名，唯一且不可为空，用于登录和显示',
    password  varchar(50)                         not null comment '用户密码（未加密存储），不可为空',
    created   timestamp default CURRENT_TIMESTAMP null comment '用户创建时间，默认为当前时间戳',
    avatar    longtext                            null,
    phone     varchar(20)                         null,
    user_role varchar(255)                        null,
    email     varchar(255)                        null,
    gender    varchar(255)                        null,
    timezone  varchar(255)                        null,
    status    int                                 null,
    constraint username
        unique (username)
)
    comment '系统用户信息表';

